import React from 'react'
import { Input } from '../../UI/Input'
import './MealItemForm.module.css'

export const MealItemForm = (props) => {
    return (
        <form>
            <Input label = 'Amount' input = {{
                id: 'amount',
                type: 'number',
                min: `1`,
                max: 5``,
                step: 1
            }}/>
            <button>Add +</button>
        </form>
    )
}
